import React, { useState, useEffect } from "react";
import { motion } from "framer-motion";
import img1 from "../images/Boys_Reflective_Cartoon_Graphic_Top-removebg-preview.png";
import img2 from "../images/download-removebg-preview-O1tG9PqTt-transformed.png";
import img3 from "../images/T-_SHIRT-removebg-preview-transformed.png";


export default function App() {
  const tshirts = [
    { id: 1, src: img1 },
    { id: 2, src: img2 },
    { id: 3, src: img3 },
  ];

  return (
    <div className="app">
      <header className="navbar">
        <div className="logo">Tee Design Hub</div>
        <nav>
          <ul>
            <li className="headerOptions">Home</li>
            <li className="headerOptions">About</li>
            <li className="headerOptions">Products</li>
            <li className="headerOptions">Contact</li>
            <li className="headerOptions">Shop</li>
          </ul>
        </nav>
      </header>
      <main className="hero-section">
        <div className="text-content">
          <h1>
            Design <br /> Your <br /> Dream T-
          </h1>
          <p>
            Choose from stylish presets or create your own by uploading designs,
            adding text, or graphics.
          </p>
          <button className="get-started">Get Started</button>
        </div>
        <div className="tshirt-display">
          <div className="tshirt-container">
            {tshirts.map((tshirt) => (
              <img
                key={tshirt.id}
                src={tshirt.src}
                alt={`Tshirt ${tshirt.id}`}
                className="tshirt"
              />
            ))}
          </div>
        </div>
      </main>
    </div>
  );
}
